#include <stdio.h>
#include <time.h>
#include <gmp.h>
int main()
{
	int count = 0;
	clock_t start = clock();
	char buf[1024];
	mpz_t n0, n1, n2;
	mpz_inits(n0, n1, n2, 0);
	mpz_set_str(n1, "", 10);
	
	mpz_set_str(n2, "6876766832351765396496377534476050002970857483815262918450355869850085167053394672634315391224052153", 10);
	while (clock() - start < CLOCKS_PER_SEC)
	{
	//mpz_set_str(n1, "12", 10);
	//mpz_set_str(n2, "2", 10);
	//mpz_set_str(n0, "3", 10);
		mpz_cdiv_q(n0, n1, n2);
		mpz_get_str(buf, 10, n0);
		count++;
	}
	printf("time = %d, count = %d\n", (clock() - start)/CLOCKS_PER_SEC, count);

	
//	mpz_out_str(1, 10, n0);
	return 0;
}
